    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1942. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, receipts and collections, and fires. Resource
    management is outlined; topics include grazing and haying. The public relations
    section of the report describes recreational uses, Refuge visitors, and Refuge participation.
    N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
